import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Click the search button
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Click on the product link
    await page.waitForSelector('text=Apple iPhone 15 Pro Max, 256GB, Natural Titanium');
    await page.click('text=Apple iPhone 15 Pro Max, 256GB, Natural Titanium');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));

    // Click on the "Add to Wish List" button
    await page.waitForSelector('.add-to-wishlist');
    await page.click('.add-to-wishlist');
    await page.waitForTimeout(1000); // Wait for any potential animations or loading
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_wishlist.png'));

    // Extract confirmation message or data
    const confirmationMessage = await page.innerText('.notification.success');

    return {
      success: true,
      action: "Added product to wishlist",
      extractedData: { confirmationMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
